import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className = "App">

      <div className = "Component">

        <img/>

        <div>
          <h2 style = { { marginBottom : "8px"} }>Name</h2>

          <div style = { { display : "flex", height : "56px" } }>
            <img className = "type"/>

            <div style = { { height : "100%" } }>
              <h3>Type</h3>
              <p>Tags</p>
            </div>
          </div>
        </div>

      </div>

    </div>
  );
}

export default App;
